description:
Doc and Lena Selyanina
Der Leiermann

Musictrade single release
Duration 7:59
Released on 2008-05-18 
Both 24bit 88.2kHz FLAC version and LAME HVBR mp3 version included


This jazzy ambient song is inspired by the similarly titled song from Franz Schubert&amp;#039;s song cycle Winterreise and builds on Lena&amp;#039;s beautiful piano improvisations that flow freely around Schubert&amp;#039;s theme. In the song, a wanderer meets an old barefooted hurdy-gurdy man playing his melodies, symbolizing possibly death for the wanderer himself.


